    return(
    <>
    <navigationBar/>
    <div className="mainBtn">
            <nav>
                <ul>
                    <li>Search Images</li>
                    <li>Search Users</li>
                </ul>
            </nav>
        </div>
    </>

    )
}

export default DashBoard
